import React from 'react';
import '../styles/Pricing.css';

const wallpapers = [
  { id: 1, src: 'wallpaper1.jpg', category: 'Nature' },
  { id: 2, src: 'wallpaper2.jpg', category: 'Cars' },
  { id: 3, src: 'wallpaper3.jpg', category: 'Buildings' },
  { id: 4, src: 'wallpaper4.jpg', category: 'Space' },
  // Add more wallpaper objects as needed
];

function Gallery() {
  return (
    <section id ="gallery">
    <div className="gallery-container">
      <h1 className="gallery-title">Choose Your Wallpaper</h1>
      <div className="gallery-grid">
        {wallpapers.map((wallpaper) => (
          <div className="gallery-item" key={wallpaper.id}>
            <img
              src={wallpaper.src}
              alt={wallpaper.category}
              className="gallery-image"
            />
            <div className="gallery-hover">
              <p>{wallpaper.category}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
    </section>
  );
}


export default Gallery;
